Aplicația Barza te ghidează pe parcursul ciclului menstrual și îți indică schimbările hormonale care îți pot influența viața de zi cu zi. 

Predispoziția unor anumite stări sau simptome diferă în funcție de fiecare persoană în parte și poate fi influențată de un cumul de factori. Această aplicație nu poate stabili un diagnostic, un tratament și nu substituie o metodă contraceptivă. 

Aplicația Barza nu substituie consultul medical de specialitate. 

Aplicația BARZA te ajută să recunoști și să înțelegi schimbările hormonale care se petrec pe parcursul unui ciclu menstrual: 
-  îți oferă detalii cu privire la stările prin care poți trece din punct de vedere fizic și emoțional și te ajută cu sfaturi personalizate;
- conține un calendar detaliat cu ajutorul căruia îți poți monitoriza evoluția perioadei unui ciclu menstrual;
- îți oferă posibilitatea de a seta durata menstruației și îți indică posibile schimbări prin care corpul tău trece pe toată durata ciclului menstrual;
- îți oferă recomandări de produse suport din portofoliul BARZA, care te pot ajuta pentru fiecare etapă a unui ciclu menstrual;
- îți oferă posibilitatea de a-ți seta o oră preferată pentru notificări zilnice;

Aplicația Barza este un produs oferit de Testul Barza, primul test de sarcină din România, lansat în 1995, recomandat de Societatea de Obstetrică și Ginecologie. 

